const Testimonials = () => {
  return (
    <div className='max-w-5xl mx-auto mt-16'>
      <h1 className='text-blue-600 font-semibold text-3xl font-palanquin'>Skills <span className='text-black'>and</span> Technologies</h1>
      <p className='text-slate-gray mt-1 font-montserrat text-lg'>I can't lie, these are the enablers of my success!</p>
    </div>
  )
}

export default Testimonials
